class Login extends React.Component {
  render() {
    return (
      <section>
        <div style="background-color: red">
          <label htmlFor="email-login">
            <input type="text" name="email-login" placeholder="Digite seu Email" />
          </label>
        </div>
      </section>
    );
  }
}

export default Login;
